import '../App.css';
import { useState } from 'react';
import arrowIcon from "../images/arrow.png"
import dashboard from "../assets/dashboard.png"
function Projects() {
    const goToContact = () => {
        window.location.href = './#contact';
    }

    return (
        <section id="projects">
            <p className='section__text__p1'>Browse My School</p>
            <h1 className='title'>Projects</h1>
            <div className='skill-detail-containers'>
                <div className='details-container color-container'>
                    <div className='article-container'>
                        <img src={dashboard} alt='dashboard' className='project-img' />
                    </div>
                    <h2 className='skill-sub-title project-title'>
                        Visualization Dashboard
                    </h2>
                    <div className='btn-container'>
                        <button class="btn btn-color-2 project-btn"></button>
                    </div>
                </div>
            </div>
        </section>
    );
}

export default Projects;
